\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0443 \u0418\u043d\u0434\u043e\u043d\u0435\u0437\u0438\u044e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1957_%D0%B3%D0%BE%D0%B4\" title=\"1957 \u0433\u043e\u0434\">1957<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%BE%D0%BB%D0%BA%D0%BD%D0%BE%D0%B2%D0%B5%D0%BD%D0%B8%D0%B5_%D0%B4%D0%B2%D1%83%D1%85_%D0%98%D0%BB-14_%D0%BD%D0%B0%D0%B4_%D0%9A%D0%B8%D0%B5%D0%B2%D0%BE%D0%BC\" title=\"\u0421\u0442\u043e\u043b\u043a\u043d\u043e\u0432\u0435\u043d\u0438\u0435 \u0434\u0432\u0443\u0445 \u0418\u043b-14 \u043d\u0430\u0434 \u041a\u0438\u0435\u0432\u043e\u043c\">\u0441\u0442\u043e\u043b\u043a\u043d\u043e\u0432\u0435\u043d\u0438\u0435 \u0434\u0432\u0443\u0445 \u0418\u043b-14 \u043d\u0430\u0434 \u041a\u0438\u0435\u0432\u043e\u043c<\/a>, \u043f\u043e\u0433\u0438\u0431\u043b\u0438 15 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1958_%D0%B3%D0%BE%D0%B4\" title=\"1958 \u0433\u043e\u0434\">1958<\/a>&#160;\u2014 \u043b\u0438\u0434\u0435\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%82%D0%B0%D0%B9\" class=\"mw-redirect\" title=\"\u041a\u0438\u0442\u0430\u0439\">\u041a\u0438\u0442\u0430\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BE_%D0%A6%D0%B7%D1%8D%D0%B4%D1%83%D0%BD\" title=\"\u041c\u0430\u043e \u0426\u0437\u044d\u0434\u0443\u043d\">\u041c\u0430\u043e \u0426\u0437\u044d\u0434\u0443\u043d<\/a> \u043e\u0431\u044a\u044f\u0432\u0438\u043b \u043d\u0430\u0447\u0430\u043b\u043e \u043f\u043e\u043b\u0438\u0442\u0438\u043a\u0438 \u00ab\u0431\u043e\u043b\u044c\u0448\u043e\u0433\u043e \u0441\u043a\u0430\u0447\u043a\u0430\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1960_%D0%B3%D0%BE%D0%B4\" title=\"1960 \u0433\u043e\u0434\">1960<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%B1%D0%BE%D0%BD\" title=\"\u0413\u0430\u0431\u043e\u043d\">\u0413\u0430\u0431\u043e\u043d<\/a> \u043e\u0431\u044a\u044f\u0432\u0438\u043b \u043e \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u0438 \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1961_%D0%B3%D0%BE%D0%B4\" title=\"1961 \u0433\u043e\u0434\">1961<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a> \u0441\u043e\u0437\u0434\u0430\u043d\u0430 \u0441\u0438\u0441\u0442\u0435\u043c\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B0%D0%B6%D0%B4%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BE%D1%80%D0%BE%D0%BD%D0%B0\" title=\"\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0430\u044f \u043e\u0431\u043e\u0440\u043e\u043d\u0430\">\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u043e\u0439 \u043e\u0431\u043e\u0440\u043e\u043d\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1962_%D0%B3%D0%BE%D0%B4\" title=\"1962 \u0433\u043e\u0434\">1962<\/a>&#160;\u2014 \u043f\u0435\u0440\u0432\u044b\u0439 \u0443\u0431\u0438\u0442\u044b\u0439 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%82%D0%B5%D1%80_%D0%A4%D0%B5%D1%85%D1%82%D0%B5%D1%80\" class=\"mw-redirect\" title=\"\u041f\u0435\u0442\u0435\u0440 \u0424\u0435\u0445\u0442\u0435\u0440\">\u041f\u0435\u0442\u0435\u0440 \u0424\u0435\u0445\u0442\u0435\u0440<\/a> (Peter Fechter)) \u043f\u0440\u0438 \u043f\u043e\u043f\u044b\u0442\u043a\u0435 \u043f\u0435\u0440\u0435\u0445\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%80%D0%BB%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D1%81%D1%82%D0%B5%D0%BD%D0%B0\" title=\"\u0411\u0435\u0440\u043b\u0438\u043d\u0441\u043a\u0430\u044f \u0441\u0442\u0435\u043d\u0430\">\u0411\u0435\u0440\u043b\u0438\u043d\u0441\u043a\u043e\u0439 \u0441\u0442\u0435\u043d\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1963_%D0%B3%D0%BE%D0%B4\" title=\"1963 \u0433\u043e\u0434\">1963<\/a>&#160;\u2014 \u0437\u0430\u0442\u043e\u043d\u0443\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%BE%D0%BC\" title=\"\u041f\u0430\u0440\u043e\u043c\">\u043f\u0430\u0440\u043e\u043c<\/a>, \u0441\u043e\u0435\u0434\u0438\u043d\u044f\u0432\u0448\u0438\u0439 \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u0434\u0430\u043b\u044c\u043d\u0438\u0445 \u043e\u0441\u0442\u0440\u043e\u0432\u043e\u0432 \u0432\u043e\u0437\u043b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BA%D0%B8%D0%BD%D0%B0%D0%B2%D0%B0\" title=\"\u041e\u043a\u0438\u043d\u0430\u0432\u0430\">\u041e\u043a\u0438\u043d\u0430\u0432\u044b<\/a>, \u043f\u043e\u0433\u0438\u0431\u043b\u043e 112 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1964_%D0%B3%D0%BE%D0%B4\" title=\"1964 \u0433\u043e\u0434\">1964<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8,_%D0%91%D1%80%D1%8E%D1%81\" title=\"\u041b\u0438, \u0411\u0440\u044e\u0441\">\u0411\u0440\u044e\u0441 \u041b\u0438<\/a> \u0436\u0435\u043d\u0438\u043b\u0441\u044f \u043d\u0430 \u041b\u0438\u043d\u0434\u0435 \u041a\u0435\u0434\u0443\u044d\u043b\u043b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1965_%D0%B3%D0%BE%D0%B4\" title=\"1965 \u0433\u043e\u0434\">1965<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B2%D0%BE_%D0%92%D1%8C%D0%B5%D1%82%D0%BD%D0%B0%D0%BC%D0%B5\" title=\"\u0412\u043e\u0439\u043d\u0430 \u0432\u043e \u0412\u044c\u0435\u0442\u043d\u0430\u043c\u0435\">\u0412\u044c\u0435\u0442\u043d\u0430\u043c\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430<\/a>: \u043d\u0430 \u043f\u043e\u043b\u0443\u043e\u0441\u0442\u0440\u043e\u0432\u0435 \u0412\u0430\u043d\u0442\u044b\u043e\u043d\u0433 \u043d\u0430\u0447\u0430\u043b\u0430\u0441\u044c \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F_%C2%ABStarlite%C2%BB\" class=\"mw-redirect\" title=\"\u041e\u043f\u0435\u0440\u0430\u0446\u0438\u044f \u00abStarlite\u00bb\">Starlite<\/a>\u00bb, \u043f\u0435\u0440\u0432\u0430\u044f \u043a\u0440\u0443\u043f\u043d\u0430\u044f \u043d\u0430\u0437\u0435\u043c\u043d\u0430\u044f \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f \u0432\u043e\u0439\u0441\u043a \u0421\u0428\u0410 \u0432\u043e \u0412\u044c\u0435\u0442\u043d\u0430\u043c\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1967_%D0%B3%D0%BE%D0%B4\" title=\"1967 \u0433\u043e\u0434\">1967<\/a>&#160;\u2014 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0431\u043e\u043a\u0441\u0451\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B8,_%D0%9C%D0%BE%D1%85%D0%B0%D0%BC%D0%BC%D0%B5%D0%B4\" title=\"\u0410\u043b\u0438, \u041c\u043e\u0445\u0430\u043c\u043c\u0435\u0434\">\u041c\u0443\u0445\u0430\u043c\u043c\u0435\u0434 \u0410\u043b\u0438<\/a> \u0436\u0435\u043d\u0438\u043b\u0441\u044f \u043d\u0430 \u043e\u0440\u0442\u043e\u0434\u043e\u043a\u0441\u0430\u043b\u044c\u043d\u043e\u0439 \u043c\u0443\u0441\u0443\u043b\u044c\u043c\u0430\u043d\u043a\u0435, \u043f\u043e\u0434\u0442\u0432\u0435\u0440\u0434\u0438\u0432 \u0441\u0432\u043e\u0439 \u043f\u0435\u0440\u0435\u0445\u043e\u0434 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BB%D0%B0%D0%BC\" title=\"\u0418\u0441\u043b\u0430\u043c\">\u0438\u0441\u043b\u0430\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1968_%D0%B3%D0%BE%D0%B4\" title=\"1968 \u0433\u043e\u0434\">1968<\/a>&#160;\u2014 \u0441\u043f\u0438\u0441\u043e\u043a \u0441\u0430\u043c\u044b\u0445 \u043f\u043e\u043f\u0443\u043b\u044f\u0440\u043d\u044b\u0445 \u043f\u043b\u0430\u0441\u0442\u0438\u043d\u043e\u043a \u0432\u043e\u0437\u0433\u043b\u0430\u0432\u0438\u043